import './Welcome.css'
export const Welcome = () => {
    return (
        <div>
            <div className='welcome'></div>
            <div className='mission'>
                <p>Welcome to the CS club. We meet on wednsays and are happy to help or teach you whatever you may need</p>
            </div>
         </div>
    )
}
